	<!--\n					<div class="content item-text-wrap" ng-show="comment.editing" ng-bind-html="comment.description | linky">\n					</div>\n				-->\n				</div>\n			</ion-list>\n\n			<div class="list card" style="clear:both;" ng-show="!editing">\n				<div class="item item-input-inset">\n					<textarea placeholder="Type your comment here..." ng-model="comment.body" style="flex:1; -webkit-flex:1" auto-grow>\n					</textarea>\n					<button class="button button-clear" ng-click="submit()">\n						Comment\n					</button>\n				</div>\n			</div>\n\n    </ion-content>\n</ion-view>\n'),e.put("templates/notifications/entity.html",'<ion-view title="" ng-controller="NotificationsEntityCtrl" class="view-bg">\n\n	<ion-nav-buttons side="left">\n        <a class="button button-clear icon ion-arrow-left-b" href="#/tab/notifications"></a>\n    </ion-nav-buttons>\n\n	<ion-content>\n		<!-- kind of mish-mashy... -->\n\n		<div class="loading" ng-if="!entity" style="margin:50px;">\n            <ion-spinner></ion-spinner>\n        </div>\n\n		<div ng-switch="entity.type" style="margin-bottom:-42px">\n			<div ng-switch-when="object" ng-controller="DiscoverCtrl">\n				<div class="list card tabs-background-white {{entity.subtype}}" ng-include src="\'templates/discover/entities/object.html\'"></div>\n			</div>\n			<div ng-switch-when="activity" ng-controller="NewsfeedCtrl">\n				<activity-view class="activity-item list card"></activity-view>\n			</div>\n		</div>\n\n		<!-- show comments here -->\n		<ion-list>\n			<div class="loading">\n				<ion-spinner ng-if="comments.length == 0 && inprogress"></ion-spinner>\n			</div>\n\n			<div class="load-earlier" ng-click="getComments()" ng-show="hasMore">\n				tap to load earlier\n			</div>\n\n			<div ng-repeat="comment in comments" class="comment-item" ng-class-future="$even ? \'even\' : \'odd\'">\n\n				<a href="#/tab/newsfeed/channel/{{comment.ownerObj.guid}}">\n					<img ng-src="{{$root.node_url}}icon/{{comment.ownerObj.guid}}/small"/>\n				</a>\n\n				<div class="content item-text-wrap" ng-bind-html="comment.description | linky" ng-click="openCommentActions(comment)" ng-show="!comment.editing"></div>\n\n        <!-- editing of comment -->\n        <div class="content item-text-wrap" ng-show="comment.editing">\n            <div class="item item-input-inset comment-item-edit">\n                <label class="item-input-wrapper" style="background:transparent">\n                    <textarea placeholder="Type your comment here..." class="comment-edit-text-area" ng-model="comment.description" auto-grow>\n                    </textarea>\n                </label>\n                <button class="button button-clear" ng-click="edit(comment)">\n                  Save\n                </button>\n            </div>\n        </div>\n\n			</div>\n		</ion-list>\n		<div class="list card" style="clear:both;">\n			<div class="item item-input-inset">\n				<textarea placeholder="Type your comment here..." ng-model="comment.body" style="flex:1; -webkit-flex:1;" auto-grow>\n				</textarea>\n				<button class="button button-clear" ng-click="submit()">\n					Comment\n				</button>\n			</div>\n		</div>\n\n	</ion-content>\n</ion-view>\n'),e.put("templates/notifications/list.html",'<ion-view title="Notifications" ng-controller="NotificationsCtrl" class="view-bg">\n\n    <ion-nav-buttons side="left">\n        <!--<a class="button button-clear icon ion-compose" ng-click="composer.show($event)"></a>-->\n        <a class="button button-clear icon ion-arrow-graph-up-right minds-blue" style="color:#4690C3" href="#/tab/notifications/p2p-review"></a>\n    </ion-nav-buttons>\n\n	<ion-content>\n\n		<ion-list>\n\n			<ion-refresher\n				pulling-text="Pull to refresh..."\n				on-refresh="refresh()">\n			</ion-refresher>\n\n			<div class="notification-item list card item-text-wrap" ng-repeat="notification in notificationItems">\n				<div class="item item-avatar item-text-wrap">\n                   	<img ng-src="{{$root.node_url}}icon/{{notification.from_guid}}" 